import React from 'react';
import './Body.css';
import RoomCard from './RoomCard';

export default function Body(rooms) {

    return (
        <div id="body">
            BODY

            <div>
                {
                    rooms.map(room => (
                        <RoomCard host={room.host} game={room.game} />
                    ))
                }
            </div>
        </div>   
    )
}
